import React from "react";
import { GCULogoLong } from "./GCULogoLong";
import { PURPLE_GRADIENT } from "./theme";

const SPACING = "12px";

export const GCUStudentIdCard = () => {
  return (
    <div style={{ background: PURPLE_GRADIENT }}>
      <div
        style={{
          padding: SPACING,
          width: "66.66%",
        }}
      >
        <GCULogoLong />
      </div>
    </div>
  );
};
